import React from 'react';

const AdminDashboard = () => (
  <div style={{ background: '#181A20', minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
    <div style={{ background: '#23272F', borderRadius: '1.2rem', padding: '2.5rem 2rem', boxShadow: '0 2px 16px rgba(0,0,0,0.12)', minWidth: '320px', maxWidth: '500px', width: '100%', color: '#E5E7EB', textAlign: 'center' }}>
      <h1 style={{ color: '#2ECC71', fontWeight: 800, fontSize: '2.2rem', marginBottom: '1.2rem' }}>Admin Dashboard</h1>
      <p style={{ fontSize: '1.1rem', marginBottom: '2rem' }}>
        Welcome, Admin! Here you can manage users, approve subscriptions, and view site statistics.
      </p>
      <div style={{ color: '#A0AEC0', fontSize: '1rem' }}>(Admin features coming soon...)</div>
    </div>
  </div>
);

export default AdminDashboard;
